import datetime
import json

class User:
    def __init__(self, user_type):
        self.user_type = user_type

class Submission:
    def __init__(self, submission_id, data):
        self.submission_id = submission_id
        self.data = data
        self.publish_status = None

    def update_publish_status(self, status):
        self.publish_status = status
        # Simulate logging the status update
        print(f"Submission {self.submission_id} status updated to {self.publish_status}")

class Log:
    @staticmethod
    def log(message):
        print(f"{datetime.datetime.now()}: {message}")

class FABSUser(User):
    def __init__(self, user_id):
        super().__init__('FABS User')
        self.user_id = user_id

    def submit_data(self, submission):
        Log.log(f"User {self.user_id} submitted data for submission ID: {submission.submission_id}")
        # Assume submission validation logic here
        submission.update_publish_status('Submitted')

    def download_file(self, submission):
        Log.log(f"User {self.user_id} downloaded file for submission ID: {submission.submission_id}")

class AgencyUser(User):
    def __init__(self, user_id):
        super().__init__('Agency User')
        self.user_id = user_id

    def include_flexfields(self, flexfields):
        Log.log(f"User {self.user_id} included flexfields: {json.dumps(flexfields)}")

class UIDesigner(User):
    def __init__(self, user_id):
        super().__init__('UI Designer')
        self.user_id = user_id

    def report_to_agencies(self, report):
        Log.log(f"User {self.user_id} reported to agencies: {report}")

    def move_on_to_edits(self, page_name, round_number):
        Log.log(f"User {self.user_id} moving on to round {round_number} of {page_name} edits")

class Developer(User):
    def __init__(self, user_id):
        super().__init__('Developer')
        self.user_id = user_id

    def update_validation_rules(self, rule_updates):
        Log.log(f"User {self.user_id} updated validation rules: {json.dumps(rule_updates)}")

    def manage_submission_requests(self, submission):
        Log.log(f"User {self.user_id} managed submission request for ID: {submission.submission_id}")

class Owner(User):
    def __init__(self, user_id):
        super().__init__('Owner')
        self.user_id = user_id

    def create_user_testing_summary(self, summary):
        Log.log(f"User {self.user_id} created user testing summary: {summary}")

    def reset_environment(self):
        Log.log(f"User {self.user_id} reset the environment to Staging MAX permissions")

def simulate_user_actions():
    # Create users
    developer = Developer(user_id='dev1')
    ui_designer = UIDesigner(user_id='ui1')
    agency_user = AgencyUser(user_id='agency1')
    fabs_user = FABSUser(user_id='fabs1')
    owner = Owner(user_id='owner1')

    # Simulate submission process
    submission = Submission(submission_id='12345', data={'field1': 'value1'})
    fabs_user.submit_data(submission)

    # UI Designer actions
    ui_designer.move_on_to_edits('Resources', 1)
    ui_designer.report_to_agencies('Testing completed successfully')

    # Developer actions
    developer.update_validation_rules({'rule1': 'updated', 'rule2': 'new'})

    # Owner actions
    owner.create_user_testing_summary('Summary of user testing for UI improvements')
    owner.reset_environment()

simulate_user_actions()
